import React from 'react';

const blogs = [
  {
    id: 1,
    title: "Understanding React",
    content: "This blog post explains the basics of React and how to get started.",
    author: {
      name: "Jane Doe",
      bio: "A passionate web developer and React enthusiast.",
      avatar: require('./Images/Images.png'), // Replace with actual image path
    },
  },
  {
    id: 2,
    title: "Exploring JavaScript ES6",
    content: "This post dives deep into the features introduced in ES6.",
    author: {
      name: "John Smith",
      bio: "A software engineer with a love for JavaScript.",
      avatar: require('./Images/Images.png'), // Replace with actual image path
    },
  },
  // Add more blog posts as needed
];

function Home() {
  return (
    <div className="container">
      <h1>Welcome to My Blog</h1>
      <div className="blog-container">
        {blogs.map((blog) => (
          <div className="blog-post" key={blog.id}>
            <h2>{blog.title}</h2>
            <p>{blog.content}</p>
            <div className="author-details">
              <img src={blog.author.avatar} alt={blog.author.name} className="author-avatar" />
              <div>
                <h4>{blog.author.name}</h4>
                <p>{blog.author.bio}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
